ref_map = str(aligned_str_seq.strip('-')).replace ('N','-').replace ('n','-')
insert_gap = []

for k in ref_map:
    if k != k.upper():
        insert_gap.append (True)
    else:
        insert_gap.append (False)
        

aligned_xtras = [[aln.id,''.join ([s for s in aln.seq if s == s.upper()])] for aln in aligned_xtras]

def pad_sequence (s, insert_gap):
    seq = []
    si = 0
    for k in insert_gap:
        if k:
            seq.append ('-')
        else:
            seq.append (s[si])
            si += 1 
            
    return ''.join (seq)
    
print (">%s\n%s\n" % ("REFERENCE",ref_map), file = import_settings.output)
print (">%s\n%s\n" % ("CONSENSUS", pad_sequence (ref_seq, insert_gap)), file = import_settings.output)

for xtra in aligned_xtras:
    print (">NONHUMAN:%s\n%s\n" % (xtra[0],pad_sequence(xtra[1],insert_gap)), file = import_settings.output)
   
            
for i, s in combined_fasta.items():
    print (">%s\n%s\n" % (i, pad_sequence (s, insert_gap)), file = import_settings.output)
